CREATE TABLE public.ref_transaction_types
(
    ref_tran_id numeric,
    form_type character varying(300) COLLATE pg_catalog."default",
    sched_type character varying(40) COLLATE pg_catalog."default",
    line_num character varying(10) COLLATE pg_catalog."default",
    tran_code character varying(5) COLLATE pg_catalog."default",
    tran_identifier character varying COLLATE pg_catalog."default" NOT NULL,
    tran_desc character varying(2000) COLLATE pg_catalog."default",
    parent_tran_id numeric,
    CONSTRAINT "pk_ref_transaction_types" PRIMARY KEY (tran_identifier)
);


